import { link } from "fs";
import { Fragment } from "react";
export default function ListGroup() {
  const items = ["isto", "e", "fixe"];
  return (
    <>
      <h1>bruh</h1>
      {}

      {items.length === 0 && <p>nata</p>}
      <ul className="list-group">
        {items.map((item) => (
          <li
            className="list-group-item"
            key={item}
            onClick={() => console.log("brudda")}
          >
            {item}
          </li>
        ))}
      </ul>
    </>
  );
}
